description:
Questa  la prima storica ricetta fatta da Nicol, una di quelle che aveva visto fare agli chef famosi. Ora che anche lui  uno di quegli chef, Andrea (a malincuore) ha dovuto riconoscere i meriti dell'amico.

Vuoi imparare a preparare Piatti Stellati e Gourmet come un vero PRO, entra su Acadmia.tv, la scuola di cucina online pi frequentata del web! 

Dai un'occhiata - https://www.academia.tv/

Ingredienti per 2 porzioni
Tempo di preparazione: 30 minuti
Difficolt: Media
 Petto danatra, 1;
 Limone succo, 1;
 Arancia succo, 1;
 Zucchero di canna, 6 cucchiai;
 Salsa di soia, 4 cucchiai;
 Patate, 2;
 Timo, q.b.;
 Olio/Sale/Pepe, q.b.

